import React, { Component } from 'react';

class Testimonials extends Component {
  render() {

    if(this.props.data){
      var testimonials = this.props.data.testimonials.map(function(testimonials){
        return  <li key={testimonials.user}>
            <blockquote>
               <p>{testimonials.text}</p>
               <cite>{testimonials.user}</cite>
            </blockquote>
         </li>
      })
    }

  return (
    <section id="testimonials">
  {/*    <div className="text-cointainer">
        <div className="flex-container">
          <ul className="slides center">
            {testimonials}
          </ul>
        </div>

        </div>*/}
      <section id="testimonials">
        <div className="text-container">
         <div className="row">
           <div className="two columns header-col">
               <h1><span>Client Testimonials</span></h1>
            </div>

            <div className="eight columns flex-container">
                  <ul className="slides">
                    {testimonials}
                  </ul>
               </div>
            </div>

            <div id="Iframe-Master-CC-and-Rs" className="set-margin set-padding set-border set-box-shadow center-block-horiz">
              <div className="responsive-wrapper responsive-wrapper-wxh-572x612" 
                  styles="-webkit-overflow-scrolling: touch; overflow: auto;">
                <iframe src="https://drive.google.com/file/d/1LG6BvmlEYOerU5QPb0iQV_MOF2qt3JAU/preview"></iframe>
              </div>
            </div>

         </div>
   </section>
    </section>

  );


  }
}

export default Testimonials;
